package com.ramit.dataprocessor.components;import io.swagger.annotations.ApiModel;import io.swagger.annotations.ApiModelProperty;@ApiModel(description = "Details about the data to be processed")public class DataModel {    @ApiModelProperty(notes="Autogenerated ID for the request")    long id;    @ApiModelProperty(notes="DataModel to be processed")    String data;    public long getId() {        return id;    }    public void setId(long id) {        this.id = id;    }    public String getData() {        return data;    }    public void setData(String data) {        this.data = data;    }    @Override    public String toString() {        return "DataModel{" +                "id=" + id +                ", data='" + data + '\'' +                '}';    }}